import React from "react";
import Header from "./components/cart/layout/Header";
import AvailableMeals from "./components/Meals/AvailableMeals";
import MealsSummary from "./components/Meals/MealsSummary";

function App() {
  return (
    <div>
      <Header />
      <React.Fragment>
        <MealsSummary />
        <AvailableMeals />
      </React.Fragment>
    </div>
  );
}

export default App;
